import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom';

// Your components for different routes
const DoctorHome = () => <div>Doctor Home</div>;
const ViewPatients = () => <div>View Patients</div>;
const Predictions = () => <div>Predictions</div>;
const DassScores = () => <div>Display DASS Scores</div>;
const DoctorLogin = () => <div>Doctor Login</div>;

const DoctorNavbar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('isDoctorLoggedIn');
    localStorage.removeItem('doctor');
    navigate('/doctorlogin'); 
    window.location.reload(); 
  };

  return (
    <Router>
      <nav className="doctor-navbar">
        <ul className="nav-list">
          <li>
            <Link to="/doctorhome" className="nav-link">
              Home
            </Link>
          </li>
          <li>
            <Link to="/viewpatients" className="nav-link">
              View Patients
            </Link>
          </li>
          <li>
            <Link to="/predictions" className="nav-link">
              Predictions
            </Link>
          </li>
          <li>
            <Link to="/dass-scores" className="nav-link">
              Display DASS Scores
            </Link>
          </li>
          <li>
            <button className="nav-link logout-btn" onClick={handleLogout}>
              Logout
            </button>
          </li>
        </ul>
      </nav>

      <Routes>
        <Route path="/doctorlogin" element={<DoctorLogin />} />
        <Route path="/doctorhome" element={<DoctorHome />} />
        <Route path="/viewpatients" element={<ViewPatients />} />
        <Route path="/predictions" element={<Predictions />} />
        <Route path="/dass-scores" element={<DassScores />} />
      </Routes>
    </Router>
  );
};

export default DoctorNavbar;
